import React from 'react';
import DashboardSidebar from './DashboardSidebar';
import Header from './DashboardHeader';
import '../Css/CompanyDashboard.css';

const CompanyDashboard = () => (
  <div className="dashboard">
    <DashboardSidebar />
    <div className="main">
      <Header />
      <div className="content">
        <h1>Company Dashboard</h1>
        <p>Welcome to the Company Dashboard page!</p>
        <div className="big-square-container">
          {['A', 'B', 'C', 'D'].map((letter, index) => (
            <div className={`big-square big-square-${index + 1}`} key={index}>
              <p className="corner-letter">{letter}</p>
              <div className="small-squares">
                {[1, 2, 3, 4].map((num) => (
                  <div className={`small-square small-square-${num}`} key={num}>
                    <p className="description-name">Description {num}</p>
                    <p className="score-name">Username {num}</p>
                  </div>
                ))}
              </div>
            </div>
          ))}
          <div className="center-words">
            <p className="top-word">Top</p>
            <p className="right-word">Right</p>
            <p className="bottom-word">Bottom</p>
            <p className="left-word">Left</p>
          </div>
        </div>
      </div>
    </div>
  </div>
);

export default CompanyDashboard;
